import { REGISTER_USER , UPDATE_USER , DELETE_USER , LOGIN , LOGOUT } from '../type';

export default (state , action) =>{
    switch(action.type) {
        case REGISTER_USER :
            console.log("ok");
        default : 
            return state;
    }
}
